int run_all_tests(Mat MatImage, Rect bounding_rect) {
    cv::Point inflationPoint(-20, -20);
    cv::Size inflationSize(20, 20);
    bounding_rect += inflationPoint;
    bounding_rect += inflationSize;
    if (0 <= bounding_rect.x && 0 <= bounding_rect.width
        && bounding_rect.x + bounding_rect.width <= MatImage.cols
        && 0 <= bounding_rect.y && 0 <= bounding_rect.height
        && bounding_rect.y + bounding_rect.height <= MatImage.rows
        && 10 <= bounding_rect.width + bounding_rect.height){
        // box within the image plane and there is a certain minimum size to it

        Mat subMat = Mat(MatImage, bounding_rect);

        double bestMatchValue = -1000000;
        int bestMatchNumber = -1;
        for (int i=1; i<6; i++){
            double curr = individualTest(subMat,i);
            __android_log_print(ANDROID_LOG_DEBUG, "LOG_TAG", "\nCurrent %d matches with %f \n", i, curr);
            if (curr > bestMatchValue) {
                bestMatchValue = curr;
                bestMatchNumber = i;
            }
        }
        __android_log_print(ANDROID_LOG_DEBUG, "LOG_TAG", "\nBest Match is %d with value %f \n", bestMatchNumber, bestMatchValue);
        return bestMatchNumber;
    } else {
        return -1;
    }
}
